import Promotions from './Components/Promotions/Promotions'

function App() {
  return (
    <div>
      <Header />
      <div className="main-content">
          <MenuNavActivity />
          <Dashboanpmrd />
          <Promotions />
      </div>
    </div>
  );
}

export default App;
